import React, {Component} from "react";
import Arthur from "./arthur.jpeg";


class biblestudy extends Component{

    render() {
        return (
            <div>
                <div className="biblestudy">
                    <img src={Arthur} className="leader"/>
                <h2>Arthur P Netala - Bible Study Leader</h2>

                <h3>We are currently reading Revelations Chapter 15.</h3>
                <h4>We have wonderful group of believers who are passionate of Christ</h4>
                </div>
            </div>


        );

    }

}

export default biblestudy;
